INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 190801, 1000001, 3.414, -416.5, 2, 1, "2030/01/01 14:59:59", 1, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", "カリン", 62, 0.0, "2025/01/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 190801, 1000002, 3.099, -416.5, 2, 1, "2030/01/01 14:59:59", 2, "ミッションをクリアして、\n報酬をゲットしましょう！", "カリン", 62, 0.0, "2025/01/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 190801, 1000003, 2.801, -416.5, 2, 1, "2030/01/01 14:59:59", 3, "受け取ることができる\n報酬があるようです\n確認してみてください", "カリン", 63, 0.0, "2025/01/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 190801, 1000004, 0.0, -416.5, 2, 1, "2030/01/01 14:59:59", 4, "報酬がもらえますよ！\nチェックしてみてください", "カリン", 63, 0.0, "2025/01/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 190801, 1000005, 2.12, -363.0, 1, 1, "2030/01/01 14:59:59", 5, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", "カリン", 64, 0.0, "2025/01/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 190801, 1000006, 1.68, -363.0, 2, 1, "2030/01/01 14:59:59", 6, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", "カリン", 64, 0.0, "2025/01/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 190801, 1000007, 2.33, -363.0, 1, 1, "2030/01/01 14:59:59", 7, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", "カリン", 64, 0.0, "2025/01/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (3, 133701, 1020101, 5.18, -285.0, 7, 10201, "2030/01/01 14:59:59", 101, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", "ラビリスタ", 61, -6.0, "2025/01/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 133901, 1020102, 8.77, -285.0, 2, 10201, "2030/01/01 14:59:59", 201, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", "クリスティーナ", 61, -2.0, "2025/01/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (6, 133801, 1020103, 15.5, -285.0, 1, 10201, "2030/01/01 14:59:59", 301, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", "ネネカ", 61, 0.0, "2025/01/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 134301, 1020201, 9.061, -285.0, 5, 10202, "2030/01/01 14:59:59", 101, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", "ランファ", 61, 0.0, "2025/02/28 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 134401, 1020202, 7.699, -285.0, 2, 10202, "2030/01/01 14:59:59", 201, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", "チカ", 61, 0.0, "2025/02/28 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 134601, 1020301, 8.595, -285.0, 2, 10203, "2030/01/01 14:59:59", 101, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", "アオイ", 61, 0.0, "2025/03/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 134501, 1020302, 7.758, -285.0, 2, 10203, "2030/01/01 14:59:59", 201, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", "クローチェ", 61, 0.0, "2025/03/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 132302, 1020401, 7.0, -285.0, 6, 10204, "2030/01/01 14:59:59", 101, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", "ルイズマリー", 61, 0.0, "2025/04/30 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 132402, 1020402, 7.904, -285.0, 2, 10204, "2030/01/01 14:59:59", 201, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", "イロハ", 61, 0.0, "2025/04/30 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (4, 132502, 1020403, 8.487, -285.0, 2, 10204, "2030/01/01 14:59:59", 301, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", "ソノ", 61, 0.0, "2025/04/30 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 134901, 1020502, 8.763, -285.0, 2, 10205, "2030/01/01 14:59:59", 101, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", "カノン", 61, 0.0, "2025/05/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 134801, 1020503, 6.417, -285.0, 3, 10205, "2030/01/01 14:59:59", 201, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", "ツムギ", 61, 0.0, "2025/05/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (3, 135001, 1020601, 10.335, -285.0, 7, 10206, "2030/01/01 14:59:59", 101, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", "エリス", 61, 0.0, "2025/06/30 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 135101, 1020602, 6.281, -285.0, 4, 10206, "2030/01/01 14:59:59", 201, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", "シェフィ", 61, 0.0, "2025/06/30 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 135201, 1020603, 12.244, -285.0, 2, 10206, "2030/01/01 14:59:59", 301, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", "プレシア", 61, 0.0, "2025/06/30 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (2, 135301, 1020701, 6.339, -285.0, 8, 10207, "2030/01/01 14:59:59", 101, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", "クリア", 61, 0.0, "2025/07/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (7, 135401, 1020702, 8.184, -285.0, 9, 10207, "2030/01/01 14:59:59", 201, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", "アネモネ", 61, 0.0, "2025/07/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (9, 129101, 1020801, 3.906, -285.0, 2, 10208, "2030/01/01 14:59:59", 101, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", "アイラ", 61, 0.0, "2025/08/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 129201, 1020802, 14.465, -285.0, 2, 10208, "2030/01/01 14:59:59", 201, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", "シナツ", 61, 0.0, "2025/08/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (4, 100101, 1020803, 8.662, -285.0, 3, 10208, "2030/01/01 14:59:59", 301, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", "ヒヨリ", 61, 0.0, "2025/08/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 100301, 1020804, 10.915, -285.0, 3, 10208, "2030/01/01 14:59:59", 401, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", "レイ", 61, 0.0, "2025/08/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (1, 135802, 1020901, 6.042, -285.0, 7, 10209, "2030/01/01 14:59:59", 101, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", "ユキノ", 61, 0.0, "2025/09/30 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (4, 135903, 1020902, 9.402, -285.0, 1, 10209, "2030/01/01 14:59:59", 201, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", "サツキ", 61, 0.0, "2025/09/30 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (8, 136902, 1020903, 8.16, -285.0, 1, 10209, "2030/01/01 14:59:59", 301, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", "ルルィ", 61, 0.0, "2025/09/30 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (3, 137401, 1021001, 5.0, -285.0, 2, 10210, "2030/01/01 14:59:59", 101, "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", "カスミ", 61, 0.0, "2025/10/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (4, 136001, 1021002, 8.12, -285.0, 1, 10210, "2030/01/01 14:59:59", 201, "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", "アラクネ", 61, 0.0, "2025/10/31 12:00:00");
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES (4, 136202, 1021003, 6.386, -285.0, 2, 10210, "2030/01/01 14:59:59", 301, "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", "ナーナ", 61, 0.0, "2025/10/31 12:00:00");
